- input: "TEXT\x1CC00496067\x1C1\x1C\x1CF3PA\x1CThe decrease in both receipts and
    expenses on our Amended July Quarterly Report is the result of an internal campaign
    audit, commissioned to ensure we had the correct financial information reported
    in the public record. We hired a professional firm to conduct the audit and the
    results of their efforts showed both receipt and expense activity on our original
    report had been filed with incorrect dates, mostly around the close of books for
    the reporting period. We also found that in some instances expenses were reported
    that had not yet been paid.   During the audit the campaigns donor database was
    completed re-created and reconciled with the campaigns bank accounts to ensure
    accuracy. We apologize for the initial oversight and have retained a professional
    firm to help prevent any such issues going forward.  \n"
